import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

const Footer = () => {
  return (
    <footer className="relative bg-gradient-to-br from-wine-900 via-black to-wine-800 text-white overflow-hidden">
      {/* Background Effects */}
      <div className="absolute inset-0">
        <div className="absolute top-0 left-1/4 w-96 h-96 bg-coral-500/10 rounded-full blur-3xl" />
        <div className="absolute bottom-0 right-1/4 w-96 h-96 bg-gold-500/10 rounded-full blur-3xl" />
        <div className="absolute top-1/2 left-1/2 w-64 h-64 bg-mint-500/5 rounded-full blur-2xl transform -translate-x-1/2 -translate-y-1/2" />
      </div>

      <div className="relative container-max section-padding">
        {/* Main Footer Content */}
        <div className="grid grid-cols-1 md:grid-cols-4 gap-12 mb-12">
          {/* Logo y descripción épica */}
          <motion.div 
            className="col-span-1 md:col-span-2"
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <div className="flex items-center mb-6 group">
              <motion.div
                className="relative"
                whileHover={{ scale: 1.1, rotate: 5 }}
                transition={{ type: "spring", stiffness: 400, damping: 17 }}
              >
                {/* Glow effect para logo */}
                <div className="absolute -inset-3 bg-gradient-to-r from-coral-500/30 via-gold-500/30 to-mint-500/30 rounded-xl blur-lg opacity-0 group-hover:opacity-100 transition-opacity duration-500" />

                <div className="relative bg-gradient-to-br from-coral-100 to-gold-100 p-3 rounded-xl border border-coral-200/50">
                  <motion.img 
                    src="/logoo.png" 
                    alt="Logo" 
                    className="w-12 h-12 object-contain filter drop-shadow-lg"
                    whileHover={{ rotate: [0, -10, 10, 0] }}
                    transition={{ duration: 0.6 }}
                  />

                  {/* Sparkles */}
                  <div className="absolute -top-1 -right-1 w-2 h-2 bg-gold-400 rounded-full opacity-0 group-hover:opacity-100 animate-ping" />
                  <div className="absolute -bottom-1 -left-1 w-1.5 h-1.5 bg-coral-400 rounded-full opacity-0 group-hover:opacity-100 animate-pulse" />
                </div>
              </motion.div>

              <motion.div 
                className="ml-4"
                initial={{ opacity: 0, x: -20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ delay: 0.2 }}
              >
                <h3 className="text-2xl font-bold bg-gradient-to-r from-coral-400 to-gold-400 bg-clip-text text-transparent">
                  Jona
                </h3>
                <p className="text-gray-300 text-sm">Artista & Creador Digital</p>
              </motion.div>
            </div>

            <motion.p 
              className="text-gray-300 max-w-md leading-relaxed mb-6"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.4 }}
            >
              Construyo sitios web rápidos y con intención para marcas que quieren sonar fuerte en Internet. 
              <span className="text-coral-400 font-medium"> Creatividad artística + excelencia técnica.</span>
            </motion.p>

            {/* Social Links */}
            <motion.div 
              className="flex space-x-4"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.6 }}
            >
              {[
                { name: 'Email', icon: '✉️', href: 'mailto:tu@email.com', color: 'coral' },
                { name: 'WhatsApp', icon: '📱', href: 'https://wa.me/1234567890', color: 'gold' },
                { name: 'LinkedIn', icon: '💼', href: '#', color: 'tech' },
                { name: 'GitHub', icon: '⚡', href: '#', color: 'mint' }
              ].map((social, index) => (
                <motion.a
                  key={social.name}
                  href={social.href}
                  className={`w-12 h-12 bg-gradient-to-br from-${social.color}-500/20 to-${social.color}-600/20 border border-${social.color}-400/30 rounded-xl flex items-center justify-center text-xl hover:scale-110 hover:border-${social.color}-400/60 transition-all duration-300 group`}
                  whileHover={{ y: -2 }}
                  whileTap={{ scale: 0.95 }}
                  initial={{ opacity: 0, scale: 0 }}
                  animate={{ opacity: 1, scale: 1 }}
                  transition={{ delay: 0.8 + index * 0.1 }}
                >
                  <span className="filter group-hover:drop-shadow-lg">{social.icon}</span>
                </motion.a>
              ))}
            </motion.div>
          </motion.div>

          {/* Enlaces rápidos */}
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.3, duration: 0.8 }}
          >
            <h3 className="font-bold text-lg mb-6 text-coral-400">Navegación</h3>
            <ul className="space-y-3">
              {[
                { name: 'Servicios', href: '/servicios' },
                { name: 'Portfolio', href: '/portfolio' },
                { name: 'Sobre mí', href: '/sobre-mi' },
                { name: 'Blog', href: '/blog' }
              ].map((link, index) => (
                <motion.li 
                  key={link.name}
